webpackJsonp([0xe301c86f4ad],{8086:function(t,e){t.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2009/03/demo-490.jpg" alt="demo_490.jpg" border="0" width="490" height="373" /></p>\n<p>Yesterday morning we attended a rally in support of a new school in Jesteburg. I got recruited as a drummer, we were at the front of the march, and the drummers ended up in <a href="http://www.papascott.de/wordpress/wp-content/uploads/2009/03/abendblatt-demo.pdf" title="abendblatt_demo.pdf">full color in the Hamburger Abendblatt</a>. That\'s me with the white cap and the grim expression on the far left. <a href="http://www.abendblatt.de/daten/2009/03/23/1095300.html">The story</a> (without photos) is also on the Abendblatt website.</p>',fields:{title:"Yesterday's News",date:"23 Mar 2009",url:"https://papascott.de/2009-03-23-yesterdays-news/"}}},pathContext:{slug:"/2009-03-23-yesterdays-news/",prev:{fields:{title:"Irish Crab",date:"14 Mar 2009",slug:"/2009-03-14-irish-crab/"}},next:{fields:{title:"Stripes from Paris",date:"15 Apr 2009",slug:"/2009-04-15-stripes-from-paris/"}}}}}});
